import React from 'react'
import './Sidebar.css'

function Sidebar() {
    return (
        <div className='sidebar'>
            <h2>I am a sidebar</h2>
            <SidebarRow title="Home" />
            <SidebarRow title="Shorts" />
            <SidebarRow title="Subscriptions" />




        </div>
    )
}

export default Sidebar
